void CSR_LU_mat_mul(int *row_ptr, int *col_idx, int8_t *data_arr) {
    cout << "(Unrolling)CSR buffer filling\n";
    int32_t row_A = 32, col_A;
    int32_t row_B = 2, col_B;
    int16_t output_data[ROWS_A * ROWS_B];
    int16_t *input_ptr, *output_ptr;
    int64_t *bias = NULL;
    int16_t input[row_A * COLS_A];
    int8_t weight[row_B * COLS_B];
    Timer timer;
    timer.start();
    for (int i = 0; i < ROWS_B / 2; i++) {
        int col_num0 = row_ptr[2 * i + 1] - row_ptr[2 * i];
        int col_num1 = row_ptr[2 * i + 2] - row_ptr[2 * i + 1];
        int col_len = col_num0 + col_num1, j = 0, k = 0;
        while (j != col_num0 && k != col_num1) {
            if (col_idx[row_ptr[2 * i] + j] < col_idx[row_ptr[2 * i + 1] + k]) {
                j++;
            } else if (col_idx[row_ptr[2 * i] + j] > col_idx[row_ptr[2 * i + 1] + k]) {
                k++;
            } else {
                j++;
                k++;
                col_len--;
            }
        }
        col_A = col_B = col_len;
        int idx = 0, rhs0_idx = 0, rhs1_idx = 0;
        while (idx != col_len) {
            if (rhs0_idx == col_num0) {
                weight[idx] = 0;
                weight[idx + col_B] = data_arr[row_ptr[2 * i + 1] + rhs1_idx];
                for (int k = 0; k < row_A; k++) {
                    input[k * col_A + idx] = input_data[k * COLS_A + col_idx[row_ptr[2 * i + 1] + rhs1_idx]];
                }
                rhs1_idx++;
            } else if (rhs1_idx == col_num1) {
                weight[idx] = data_arr[row_ptr[2 * i] + rhs0_idx];
                weight[idx + col_B] = 0;
                for (int k = 0; k < row_A; k++) {
                    input[k * col_A + idx] = input_data[k * COLS_A + col_idx[row_ptr[2 * i] + rhs0_idx]];
                }
                rhs0_idx++;
            } else if (col_idx[row_ptr[2 * i] + rhs0_idx] > col_idx[row_ptr[2 * i + 1] + rhs1_idx]) {
                weight[idx] = 0;
                weight[idx + col_B] = data_arr[row_ptr[2 * i + 1] + rhs1_idx];
                for (int k = 0; k < row_A; k++) {
                    input[k * col_A + idx] = input_data[k * COLS_A + col_idx[row_ptr[2 * i + 1] + rhs1_idx]];
                }
                rhs1_idx++;
            } else if (col_idx[row_ptr[2 * i] + rhs0_idx] < col_idx[row_ptr[2 * i + 1] + rhs1_idx]) {
                weight[idx] = data_arr[row_ptr[2 * i] + rhs0_idx];
                weight[idx + col_B] = 0;
                for (int k = 0; k < row_A; k++) {
                    input[k * col_A + idx] = input_data[k * COLS_A + col_idx[row_ptr[2 * i] + rhs0_idx]];
                }
                rhs0_idx++;
            } else {
                weight[idx] = data_arr[row_ptr[2 * i] + rhs0_idx];
                weight[idx + col_B] = data_arr[row_ptr[2 * i + 1] + rhs1_idx];
                for (int k = 0; k < row_A; k++) {
                    input[k * col_A + idx] = input_data[k * COLS_A + col_idx[row_ptr[2 * i] + rhs0_idx]];
                }
                rhs0_idx++;
                rhs1_idx++;
            }
            idx++;
        }
        input_ptr = input;
        output_ptr = output_data + i * row_B;
        for (int j = 0; j < row_A; j++) {
            arm_nn_vec_mat_mult_t_s16(input_ptr,
                                      weight,
                                      bias,
                                      output_ptr,
                                      0,
                                      0,
                                      col_B,
                                      row_B,
                                      INT16_MIN,
                                      INT16_MAX);
            input_ptr += col_A;
            output_ptr += ROWS_B;
        }
    }
    if (ROWS_B & 0x1) {
        col_A = col_B = (row_ptr[ROWS_B] - row_ptr[ROWS_B - 1]);
        for (int j = row_ptr[ROWS_B - 1]; j < row_ptr[ROWS_B]; j++) {
            weight[j - row_ptr[ROWS_B - 1]] = data_arr[j];
            for (int k = 0; k < row_A; k++) {
                input[k * col_A + (j - row_ptr[ROWS_B - 1])] = input_data[k * COLS_A + col_idx[j]];
            }
        }
        input_ptr = input;
        output_ptr = output_data + ROWS_B - 1;
        for (int j = 0; j < row_A; j++) {
            arm_nn_vec_mat_mult_t_s16(input_ptr,
                                      weight,
                                      bias,
                                      output_ptr,
                                      0,
                                      0,
                                      col_B,
                                      1,
                                      INT16_MIN,
                                      INT16_MAX);
            input_ptr += col_A;
            output_ptr += ROWS_B;
        }
    }
    timer.stop();
    cout << "Execution time: " << timer.read_us() << "us\n";
    for (int i = 0; i < 20; i++) {
        cout << output_data[i] << ' ';
    }
    cout << "\n";
    for (int i = 0; i < 20; i++) {
        cout << output_data[ROWS_B * 28 + i] << ' ';
    }
    cout << "\n\n";
    return;
};
void CSR_mat_mul(int *row_ptr, int *col_idx, int8_t *data_arr) {
    cout << "CSR sparse kernel implementation:\n";
    int16_t output_data[ROWS_A * ROWS_B];
    int16_t *output_ptr = output_data;
    Timer timer;
    timer.start();
    for (int i = 0; i < ROWS_A; i++) {
        const int16_t *lhs = input_data + i * COLS_A;
        for (int j = 0; j < ROWS_B; j++) {
            const int8_t *rhs = data_arr + row_ptr[j];
            const int32_t col_num = row_ptr[j + 1] - row_ptr[j];
            const int32_t col_loop_cnt = col_num / 4;
            int32_t vec_part_0, vec_part_1, ker_0, ker_1;
            int32_t acc = 0;
            for (int k = 0; k < col_loop_cnt; k++) {
                const int16_t *lhs0 = (lhs + col_idx[row_ptr[j] + k * 4]);
                const int16_t *lhs1 = (lhs + col_idx[row_ptr[j] + k * 4 + 1]);
                const int16_t *lhs2 = (lhs + col_idx[row_ptr[j] + k * 4 + 2]);
                const int16_t *lhs3 = (lhs + col_idx[row_ptr[j] + k * 4 + 3]);
                vec_part_0 = PKHBT((uint32_t)*lhs0, (uint32_t)*lhs1, 16);
                vec_part_1 = PKHBT((uint32_t)*lhs2, (uint32_t)*lhs3, 16);
                rhs = read_and_pad(rhs, &ker_0, &ker_1);
                acc = SMLAD(ker_0, vec_part_0, acc);
                acc = SMLAD(ker_1, vec_part_1, acc);
            }
            for (int k = col_loop_cnt * 4; k < col_num; k++) {
                const int32_t lhs_temp = *(lhs + col_idx[row_ptr[j] + k]);
                acc += lhs_temp * (*rhs);
                rhs++;
            }
            *output_ptr++ = (int16_t)acc;
        }
    };
    timer.stop();
    cout << "Execution time: " << timer.read_us() << "us\n";
    for (int i = 0; i < 20; i++) {
        cout << output_data[i] << ' ';
    }
    cout << "\n";
    for (int i = 0; i < 20; i++) {
        cout << output_data[ROWS_B * 28 + i] << ' ';
    }
    cout << "\n\n";
    return;
};
void MCSR_mat_mul(int *row_ptr, int *col_idx, int8_t *data_arr) {
    cout << "MCSR sparse kernel implementation\n";
    int16_t output_data[ROWS_A * ROWS_B];
    int16_t *output_ptr = output_data;
    Timer timer;
    timer.start();
    for (int i = 0; i < ROWS_A; i++) {
        const int16_t *lhs = input_data + i * COLS_A;
        for (int j = 0; j < row_ptr_len - 1; j++) {
            const int32_t col_num = row_ptr[j + 1] - row_ptr[j];
            const int32_t col_loop_cnt = col_num / 2;
            const int8_t *rhs = data_arr + row_ptr[j] * 2;
            int32_t acc_0 = 0, acc_1 = 0;
            uint32_t vec_part = 0;
            for (int k = 0; k < col_loop_cnt; k++) {
                const int16_t *vec_part0 = (lhs + col_idx[row_ptr[j] + 2 * k]);
                const int16_t *vec_part1 = (lhs + col_idx[row_ptr[j] + 2 * k + 1]);
                vec_part = PKHBT((uint32_t)*vec_part0, (uint32_t)*vec_part1, 16);
                int32_t inA = arm_nn_read_s8x4_ia(&rhs);
                uint32_t inAbuf1 = SXTB16((uint32_t)inA);
                uint32_t inAbuf2 = SXTB16_RORn((uint32_t)inA, 8);
                acc_0 = SMLAD(inAbuf1, vec_part, acc_0);
                acc_1 = SMLAD(inAbuf2, vec_part, acc_1);
            }
            if (col_num & 0x1) {
                acc_0 += (*(lhs + col_idx[row_ptr[j + 1] - 1])) * (*rhs);
                rhs++;
                acc_1 += (*(lhs + col_idx[row_ptr[j + 1] - 1])) * (*rhs);
            }
            if ((ROWS_B & 0x1) && (j == row_ptr_len - 2)) {
                *output_ptr++ = (int16_t)acc_0;
            } else {
                *output_ptr++ = (int16_t)acc_0;
                *output_ptr++ = (int16_t)acc_1;
            }
        }
    }
    timer.stop();
    cout << "Execution time: " << timer.read_us() << "us\n";
    for (int i = 0; i < 20; i++) {
        cout << output_data[i] << ' ';
    }
    cout << "\n";
    for (int i = 0; i < 20; i++) {
        cout << output_data[ROWS_B * 28 + i] << ' ';
    }
    cout << "\n\n";
    return;
}
